import React, {useState} from 'react';

const Input = ({num}) => {
    const [value, setValue]=useState('')
    return (
        <input onChange={(e)=>setValue(e.target.value)} value={value} type='number' style={{"background": num===value ? 'gold' : '#2117a6'}} placeholder='Введите число' className='table-input'/>
        );
};

export default Input;
